import React from 'react';

function Home() {
  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-100 to-white flex flex-col items-center justify-start px-4 py-8">
      {/* Header */}
      <header className="text-center mb-10">
        <h1 className="text-3xl font-bold text-blue-800 mb-3">
          DPD Feedback Portal
        </h1>
        <p className="text-gray-600 text-base">
          Share feedback. Grow together.
        </p>
      </header>

      {/* Login Cards */}
      <div className="w-full flex flex-col items-center gap-6">
        {/* Manager Login Card */}
        <div className="bg-white rounded-xl shadow-md w-full max-w-sm p-6 text-center">
          <h2 className="text-lg font-semibold text-blue-700 mb-2">Manager Login</h2>
          <p className="text-sm text-gray-500 mb-4">Submit and track feedback for your team.</p>
          <button className="w-full bg-blue-600 hover:bg-blue-700 text-white py-2 rounded-lg transition">
            Login as Manager
          </button>
        </div>

        {/* Employee Login Card */}
        <div className="bg-white rounded-xl shadow-md w-full max-w-sm p-6 text-center">
          <h2 className="text-lg font-semibold text-green-700 mb-2">Employee Login</h2>
          <p className="text-sm text-gray-500 mb-4">View and acknowledge your feedback.</p>
          <button className="w-full bg-green-600 hover:bg-green-700 text-white py-2 rounded-lg transition">
            Login as Employee
          </button>
        </div>
      </div>
    </div>
  );
}

export default Home;
